int nng_msg_reserve(nng_msg *msg, size_t capacity); Messages have a certain amount of pre-reserved space, which may exceed the total size of the message. This allows for content to be added to the message later, without necessarily performing a reallocation. The nng_msg_capacity function returns the amount of prereserved space. If a message size change is required, and the new size will fit within the capacity reported by this function, then change will be done without a reallocation, and likely without a data copy as well. tip The capacity reported by nng_msg_capacity may not include reserved headroom, which is present to allow a very limited amount of content to be inserted in front of the message without requiring the rest of the message to be copied. The message size may be changed by use of the nng_msg_realloc function. This function will reallocate the underlying memory for the message msg , preserving contents while doing so. If the new size is smaller than the original message, it will truncate the message, but not perform any allocations. If reallocation fails due to insufficient memory, then the original is left intact. The nng_msg_reserve function ensures that the total message capacity is at least capacity bytes. Use of this function to ensure the total anticipated capacity is present in the message may help prevent many small allocations. Both nng_msg_realloc and nng_msg_reserve return zero on success, or may return NNG_ENOMEM if insufficient memory exists to preform allocation. important Any pointers to message content obtained before a call to nng_msg_realloc or nng_msg_reserve (or any other function that changes the message size) should be treated as invalid, as the locations pointed to may be deallocated by these functions.

