void nng_aio_cancel(nng_aio *aio);
void nng_aio_stop(nng_aio *aio); These functions are used to stop a previously submitted asynchronous I/O operation. The operation may be canceled, or may continue to completion. If no operation is in progress (perhaps because it has already completed), then these operations have no effect. If the operation is successfully canceled or aborted, then the callback will still be called. The nng_aio_abort function aborts the operation associated with aio and returns immediately without waiting. If cancellation was successful, then nng_aio_result will return err . The nng_aio_cancel function acts like nng_aio_abort, but uses the error code NNG_ECANCELED . The nng_aio_stop function aborts the aio operation with NNG_ECANCELED , and then waits the operation and any associated callback to complete. This function also marks aio itself permanently stopped, so that any new operations scheduled by I/O providers using nng_aio_begin return false. Thus this function should be used to teardown operations. tip When multiple asynchronous I/O handles are in use and need to be deallocated, it is safest to stop all of them using nng_aio_stop, before deallocating any of them with nng_aio_free , particularly if the callbacks might attempt to reschedule further operations.

