void nng_log_debug(const char *msgid, const char *msg, ...); These functions inject a a message into the logging system, where it will be processed and potentially go to system logs, standard output, or procssed further. The msgid is a short prefix that should uniquely identify the message, possibly also with some kind of category. It is recommended that strings between 8 and 16 charactes be used. As this may, but will not necessarily be displayed to the user, the content of the message should not appear solely in this field. A NULL value is permitted here, but that may make filtering the message or other automatic processing more difficult. The msg is a printf-style format string, which is used to format the message content. The following arguments are consumed in the same manner as printf. tip Applications should take care to limit the use of higher severity levels, as message logs are potentially expensive, increase stress for end users and administrators, and further may mask real problems if incorrectly over used. Warnings and error messages should be concise and actionable, and notices should only really be those things that are worthy of attention. Informational and debug messages used during development should be removed when no longer needed, as these messages can overwhelm logging subsystems and can reduce the signal-to-noise value for the message logs, impairing the diagnostic value of the logs.

