typedef enum nng_log_level nng_log_level; void nng_log_set_level(nng_log_level level);
nng_log_level nng_log_get_level(void); The nng_log_level type represents a severity for logged messages. These levels correspond to those found in the UNIX syslog subsystem, although applications should not depend upon the values being identical. The nng_log_set_level function sets the log level. Messages with a severity that is numerically greater than this (less-severe) will be discarded. The nng_log_get_level function returns the log level most recently set by nng_log_set_level or the default if that function has not been called. The log levels are defined as follows: typedef enum nng_log_level { NNG_LOG_NONE = 0, // used for filters only, NNG suppresses these NNG_LOG_ERR = 3, NNG_LOG_WARN = 4, NNG_LOG_NOTICE = 5, NNG_LOG_INFO = 6, NNG_LOG_DEBUG = 7
} nng_log_level; The value NNG_LOG_NONE may be useful to suppress message logs altogether. The default level is typically NNG_LOG_NOTICE, but applications should select a value rather than relying upon the default.

