typedef void (*nng_logger)(nng_log_level level, nng_log_facility facility, const char *msgid, const char *msg); void nng_null_logger(nng_log_level, nng_log_facility, const char *, const char *);
void nng_stderr_logger(nng_log_level, nng_log_facility, const char *, const char *);
void nng_system_logger(nng_log_level, nng_log_facility, const char *, const char *); void nng_log_set_logger(nng_logger logger); Log handlers are responsible for actually processing the logged messages. The nng_log_set_logger function installs the named logger , of type nng_logger, as the log handler. The function logger will be called when any message is meant to be processed. (Messages are first filtered by severity , then formatted, before calling the logger.) Any previously installed logger is replaced by logger . The nng_null_logger function is an implementation of nng_logger that simply discards the content. This is the default logger, so logging is disabled by default. The nng_stderr_logger function is an implementation that logs messages to the standard error stream. It will attempt to colorize messages by the severity, if the standard error is a terminal device. This can be suppressed by setting either the NO_COLOR or NNG_LOG_NO_COLOR environment variables. The nng_system_logger attempts to use an appropriate system facility to log messages. For POSIX systems, this means using syslog to process the messages. For other systems the defauilt behavior may be the same as nng_stderr_logger.

